export class Book extends Component{

    constructor(ISBN,titre,auteur,coverture){
        super(props);
        this.state={
          titre,
          auteur,
          coverture,
          ISBN
        }
      }


    render(){
        const {livre}=this.state;
        return(
            <div>
            <h1>this is a test page.</h1>
            <h5>if you're reading this then the test succeded</h5>
  
                {console.log(livre.titre)}

            </div>
        )
    }










}

export default Book;
